import Vue from 'vue'
import Router from 'vue-router'
import Home from "./Home.vue"
import Welcome from "./components/Welcome.vue"



Vue.use(Router)
export default new Router({
  routes: [
    {path:'/',component:Welcome},
    {path:'/Home',component:Home}


  ]
})
